content:
전여친이 병 생각없이 한 말에 너무 의미 부여하신듯....
4년이나 사겼다며 ..? 충분히 맞춰 갈 수 있는건데
너무 단칼에 짤라내네;

호찬은 찬열좋아하는거 같음 
호찬생각엔 찬열이랑 해닮이랑 서로 좋아하는 줄 알았는데 산책하다보니 해닮이 자기를 좋아하는걸 눈치채고 나뭇잎떼어주면서 한 번 더 확인하고 그 뒤로 &quot;말이 없어짐&quot;
다음날 &quot;해닮의 인사를 끝까지 듣지않았고&quot; 귀가 빨개진건 찬열때문. 그리고 해닮이 뭔가 쎄함을 느낀다는 것도 포인트인듯

진가현 극혐이네;;
지혼자 과잠 안 입고 ~
꼬리잡기하는데 원피스 입고~~ 무개념이니ㅜㅜ...진짜 악녀라기보다 극혐캐릭이구나....하

저건 원룸아니고 고시텔 수준이고만;
작가님 무슨 원룸이 저래요 ㅋㅋ
요즘 고시원도 저것보단 벽 튼튼하겟어요 ㅋㅋ
널판지 한장으로 벽세우는것도 아니고 ;;

꺄아아&gt;▽&lt;
워너원 강다니엘♥ 이 언급되다니요!!! ^-^
앞으로 정주행 한 편도 안 빠지고 다 보겠습니다!!!

마지막에
&#x27;그날 내 가슴 한 편이 움찔하지 않았다면 우리의 이야기는 영원히 멈춰있었을 것이다&#x27;
이 말이 찬열과 해닮이의 관계를 의미하는 거라면 찬열♡해닮의 엔딩 가능성이 있지 않을까..

안뇽하세요 뿅작가입니다~ &gt;.&lt; 
요기 댓글로 질문하고싶으신거 남겨주시면 대답할 수 있는 질문들은 후기에 답해드릴게요! 오예 신나는 큐앤에이 수쥽수쥽
그럼 시즌3 끝까지 함께 달려주셔서 감사를 표하며 이만 뿅!
